import logo from './logo.svg';
import './App.css';
import List from "./components/List";
import { Route, BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="container">
      Hello world
      <Route exact path="/" component={List} ></Route>
    </div>
    </Router>
  );
}

export default App;
